import { DataGrid } from '@material-ui/data-grid'

const columns = [
  { field: 'kafka_topic', headerName: 'Kafka Topic', width: 100 },
  { field: 'kafka_offset', headerName: 'Kafka Offset', width: 100 },
  { field: 'identifier_type', headerName: 'IdentiFHIR Type', width: 100 },
  { field: 'identifier_value', headerName: 'IdentiFHIR Value', width: 100 },
]

const Lister = ({data}) => {
  return (
    <div className='list'>
      {Array.isArray(data) ? data.map(d => 
        <div key={d.identifier_value}>{d.identifier_value}</div>
      ) : data ? <div>{data}</div> : <div>nothing here...</div>}
    </div>
  )
}

export default Lister
